import React from 'react';
import HistoryIcon from '../HistoryIcon/HistoryIcon';
import "./HistoryItem.css";

function MouseOver(event) {
    event.target.style.display = 'none';
  }
  function MouseOut(event){
    event.target.style.display="block";
  }
class HistoryItem extends React.Component {
    render() {
        return (
            <>
                <div className="HistoryItems">
                    <a href="123" className="history-link">
                        <img onMouseOver={MouseOver} onMouseOut={MouseOut} alt={this.props.item.name} className="HistoryImg" src={this.props.item.img}/>
                        <p className="title">{this.props.item.name}</p>
                        <p className="text">{this.props.item.author}</p>
                    </a>
                        <HistoryIcon/>
                  
                    
                </div>
            </>
        );
    }
}

export default HistoryItem;
